export const DataProvider = ({ children }) => {
  const [patients, setPatients] = useState([])
  const [appointments, setAppointments] = useState([])

  useEffect(() => {
    const savedPatients = localStorage.getItem("dental_patients")
    const savedAppointments = localStorage.getItem("dental_appointments")

    if (savedPatients) {
      setPatients(JSON.parse(savedPatients))
    } else {
      setPatients(DEMO_PATIENTS)
      localStorage.setItem("dental_patients", JSON.stringify(DEMO_PATIENTS))
    }

    if (savedAppointments) {
      setAppointments(JSON.parse(savedAppointments))
    } else {
      setAppointments(DEMO_APPOINTMENTS)
      localStorage.setItem("dental_appointments", JSON.stringify(DEMO_APPOINTMENTS))
    }
  }, [])

  const savePatients = (newPatients) => {
    setPatients(newPatients)
    localStorage.setItem("dental_patients", JSON.stringify(newPatients))
  }

  const saveAppointments = (newAppointments) => {
    setAppointments(newAppointments)
    localStorage.setItem("dental_appointments", JSON.stringify(newAppointments))
  }

  const addPatient = (patientData) => {
    const newPatient = {
      ...patientData,
      id: generateId(),
      createdAt: new Date().toISOString(),
    }
    const updatedPatients = [...patients, newPatient]
    savePatients(updatedPatients)
    return newPatient
  }

  const updatePatient = (id, patientData) => {
    const updatedPatients = patients.map((patient) => (patient.id === id ? { ...patient, ...patientData } : patient))
    savePatients(updatedPatients)
  }

  const deletePatient = (id) => {
    const updatedPatients = patients.filter((patient) => patient.id !== id)
    const updatedAppointments = appointments.filter((appointment) => appointment.patientId !== id)
    savePatients(updatedPatients)
    saveAppointments(updatedAppointments)
  }

  const addAppointment = (appointmentData) => {
    const patient = patients.find((p) => p.id === appointmentData.patientId)
    const newAppointment = {
      ...appointmentData,
      id: generateId(),
      patientName: patient ? patient.name : "Unknown Patient",
      files: appointmentData.files || [],
      createdAt: new Date().toISOString(),
    }
    const updatedAppointments = [...appointments, newAppointment]
    saveAppointments(updatedAppointments)
    return newAppointment
  }

  const updateAppointment = (id, appointmentData) => {
    const patient = patients.find((p) => p.id === appointmentData.patientId)
    const updatedAppointments = appointments.map((appointment) =>
      appointment.id === id
        ? {
            ...appointment,
            ...appointmentData,
            patientName: patient ? patient.name : appointment.patientName,
          }
        : appointment,
    )
    saveAppointments(updatedAppointments)
  }

  const deleteAppointment = (id) => {
    const updatedAppointments = appointments.filter((appointment) => appointment.id !== id)
    saveAppointments(updatedAppointments)
  }

  const getPatientAppointments = (patientId) => {
    return appointments.filter((appointment) => appointment.patientId === patientId)
  }

  const value = {
    patients,
    appointments,
    addPatient,
    updatePatient,
    deletePatient,
    addAppointment,
    updateAppointment,
    deleteAppointment,
    getPatientAppointments,
  }

  return <DataContext.Provider value={value}>{children}</DataContext.Provider>
}
